import './App.css';
import { BrowserRouter, Route, Routes } from "react-router-dom";

import Main_page from './pages/main_page/main_page';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Main_page />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
